const Check = (props) => {
    const { onChange, data: { id, description, done } } = props;



    return (
        <div>
            <label className="todo new-item">
                <input
                    className="todo__state"
                    name={id}
                    type="checkbox"
                    defaultChecked={done}
                    onChange={onChange}
                />
                <div className="todo__text">{description}</div>
            </label>




        </div>
    )
}

export default Check
